import React from "react";
import VisiteurNavbar from "components/Navbars/VisiteurNavbar.js";
import Footer from "components/Footers/Footer";
import { Link } from "react-router-dom";

function HomepageVisiteur() {
  return (
    <div style={containerStyle}>
      <VisiteurNavbar />

      <div style={heroStyle}>
        <div style={heroContentStyle}>
          <div style={textContainerStyle}>
            <h2 style={titleStyle}>STB Gestion des tickets</h2>
            <p style={subtitleStyle}>
              Bienvenue sur la plateforme de gestion des tickets de la STB. Cet
              outil permet de gÃ©rer efficacement les demandes et incidents au
              sein de l'organisation.
            </p>
            <div style={buttonGroupStyle}>
              <Link to="/login">
                <button style={simpleButtonStyle}>Commencer maintenant</button>
              </Link>
            </div>
          </div>

          <img
            src="https://www.millim.tn/media/uploads/2023/07/26/stb.webp"
            alt="Interface de gestion"
            style={imageStyle}
          />
        </div>
      </div>

      <Footer />
    </div>
  );
}

// ðŸ”½ STYLES

const containerStyle = {
  minHeight: "100vh",
  backgroundColor: "#f8f9fa",
};

const heroStyle = {
  padding: "4rem 2rem",
  backgroundColor: "#ffffff",
  marginTop: "50px",
};

const heroContentStyle = {
  maxWidth: "1200px",
  margin: "0 auto",
  display: "flex",
  alignItems: "center",
  justifyContent: "space-between",
  gap: "4rem",
  flexWrap: "wrap",
};

const textContainerStyle = { flex: 1 };

const titleStyle = {
  fontSize: "2.5rem",
  color: "#2d3436",
  marginBottom: "1rem",
};

const subtitleStyle = {
  fontSize: "1.2rem",
  color: "#636e72",
  marginBottom: "2rem",
};

const buttonGroupStyle = {
  display: "flex",
  justifyContent: "flex-start",
};

const simpleButtonStyle = {
  padding: "0.8rem 2rem",
  backgroundColor: "#007bff",
  color: "#fff",
  border: "none",
  borderRadius: "5px",
  fontSize: "1rem",
  cursor: "pointer",
};

const imageStyle = {
  flex: 1,
  maxWidth: "600px",
  borderRadius: "12px",
  boxShadow: "0 10px 20px rgba(0,0,0,0.1)",
};

export default HomepageVisiteur;
